                              reviewText:
                                   "Coming from another colonised Asian country, we don‚Äôt learn as much about Vietnam War in history class. So imagine my surprise as I walk through the exhibitions reading and seeing what happened during the occupation. War is never an answer.\n\nSpanning around 3 floors, the museum was very educational for anyone interested in Vietnam war, which I must say is a must visit for everyone. It is interesting to see the exhibits from the Vietnamese perspective which may be different from what was portrayed in the Western media. They even have audio guides in different languages and every exhibits is labelled in both English & Vietnamese.\n\nAnd as someone from healthcare, my favourite exhibition has to be the one on Agent Orange. It is eye opening to see how radioactives affect the children causing genetic mutations resulting in rare syndromes such as Crouzan syndrome, Neurofibromatosis etc.\n\nThe museum however is not air conditioned, but is equipped with fans. It might be a bit hot in there.\n\nAlso dont miss out on the Tiger cages located outside of the museum, on the right near the exit. I didn‚Äôt take any pictures as it was too disturbing. They have out together jails and cages used during the War in there.\n\nVery educational 10/10",
