                                   "Very cool experience! So many different paths and artwork that takes you on a whole journey. If you‚Äôre going with kids make sure to stay close to them as there are many thin paths which are pretty dangerous if they fall as it is pretty high up. Anyone can come here and have a pretty good time. I definitely wouldn‚Äôt recommend staying in the actual hotel though as it is very touristy and we were easily able to look into rooms.",
