                              reviewerName: "Jessica",
                              reviewText:
                                   "Bizarre and fascinating. We loved exploring the Crazy House especially walking along the narrow, abstract, and meandering staircases that lead to other mini pockets of madness. If you like art or wacky things, you must visit this place.\n\nThis place gets super busy at all times with intrigued visitors alike, so be prepared for traffic as you marvel at the structures and scenes this house has to offer. There‚Äôs also a place to grab a bite and coffee that is semi-attached to the garden area of Crazy House - Crazy Coffee. A nice place to take a moment after exploring the madness of this place.\n\nIn all honesty we were apprehensive about visiting this place as we tend to stray from the overly touristic activities whilst travelling, but I felt compelled to see the Crazy House as I love bizarreness. Although very touristy, it didn‚Äôt take away from the experience and I‚Äôd definitely recommend visiting here regardless.\n\nUseful info:\n\n- 60,000 Dong to enter.\n- Purchase a ticket from the tiny booth just to the left of the entrance before you proceed. We noticed a fair few people being confused as to where tickets are possessed as it kind of looks like just another part of the building as opposed to a kiosk.",
