                              reviewText:
                                   "Really worth a visit. I think when most people think of fine arts, we think of the masterpieces of the western Old Masters like Rembrandt, stunning paintings on canvas. But the moment you enter here, you are treated to a surprise‚Äîelaborate sculptures cut from rock meant to adorn pagodas, wooden painted buddhas larger than life, and the most enthralling lacquer paintings filled with more detail than a where‚Äôs waldo page. And yes there are plenty of incredible paintings in oil in the western style, but the plethora of these other works in other mediums created a shift in my mind: fine arts is not limited to the Western ideals. Was really eye-opening for me. The museum is also much bigger than it initially seems. Good choice for a rainy day in Hanoi.",
