                                   "The Heritage House - Old Town of Hanoi, 87 Ma May - Hanoi, Vietnam\n\nOne of the Old Quarter‚Äôs best-restored properties, this traditional merchants‚Äô house is sparsely but beautifully decorated, with rooms filled with fine furniture set around two courtyards. Note the high steps between rooms, a traditional design incorporated to stop the flow of bad energy around the property. There are crafts and trinkets for sale here, including silver jewellery, basketwork and Vietnamese tea sets, and there‚Äôs usually a calligrapher or another craftsperson at work too.\n\nHow to get there\nThe ancient house sits at 87 Ma May, a popular Hanoi Old Quarter street. You can easily walk there for less than 10 minutes from Hoan Kiem lake.\n\nUseful Information\nLocation: 87 Ma May Street, Hoan Kiem, Hanoi\nBest for Family, couple, solo\nEntrance: 20,000\nHours: 8:30 AM - 4:30 PM\nDistance to city centre: 2.1km (1.3 mi)",
