                              reviewText:
                                   "Beautiful historical & cultural site. The natural beauty & landscape was mesmerizing. Pro tip: Go Early! Tour busses seem to arrive around 8:30. Please know this is a mountain. There are many, many steps & the terrain is uneven. The elevator (there is a small charge for the elevator in addition to the admission) only takes you part way up the hill to a small viewing area, there are A LOT of steps after that also. If you are heat sensitive, be cautious. Most areas are small with little air flow.  The mountains are truly spectacular. There are many paths & ‚Äònooks & cranny‚Äôs‚Äô to explore, however, know what you are embarking on before going. If you have the physical means to do this, I highly recommend!",
