                              reviewerName: "tamra.666",
                              reviewText:
                                   "Es handelt sich hierbei um einen wundersch√∂nen Tempel, in mitten von Hue. Als wir da waren, waren kaum Touristen vor Ort, es waren eher einheimische, die diesen Ort besucht haben. Ihr werdet am Anfang von einheimischen abgefangen, die euch dazu auffordern, auf einem Parkplatz zu parken. Diese k√∂nnt ihr guten Gewissens umfahren, denn ein paar Meter weiter k√∂nnt ihr mit dem Roller oder dem Motorrad an der Stra√üe auf einer Art Pflastersteinen kostenlos parken.\nDer eigentliche Tempel kommt etwas weiter hinten, in diesem Bereich sind Schilder aufgestellt, diese bitte auch lesen und ihnen folgen!\nWir, als Touristen, kommen in dieses Land und besichtigen bestimmte Sehensw√ºrdigkeiten und Tempel, da kann es wohl auch von uns verlangt werden, uns hier geltende Kleiderordnung und Regeln zu halten. Schultern sowie Knie, vor allem bei Frauen, sollten bedeckt sein. Wenn ihr ein kurzes Sommerkleid an habt, dann geht dort einfach nicht rein!! Ich sehe immer wieder Frauen, denen das anscheinend total egal ist? Verstehe ich nicht, denn das ist ein Glaube, eine Religion, der man Respekt zollen sollte. Das Schild, dass auf die Kleiderordnung hinweist, kann man nicht √ºbersehen, da es direkt am Eingang h√§ngt.\nMan muss jetzt nicht lesen k√∂nnen, einfach nur Augen im Kopf besitzen.\nBeim betreten des Tempels sind die Schuhe auszuziehen, auch das ist eine Sache des Respekt vor dem Glauben. Komplett hinein darf man nur, wenn man auch beten m√∂chte, dennoch hat man die M√∂glichkeit hinein zu sehen.\nEs ist wirklich ein wundersch√∂ner, atemberaubender und spiritueller Ort.\nHierf√ºr gebe ich eine glatte zehn von zehn.\n\n(Translated by Google)\nThis is a beautiful temple in the middle of Hue. When we were there there were hardly any tourists there, it was mostly locals who visited this place. At the beginning you will be intercepted by locals who ask you to park in a parking lot. You can bypass these with a clear conscience, because a few meters further you can park your scooter or motorbike for free on a kind of paving stones on the street.\nThe actual temple is a little further back, there are signs in this area, please read them and follow them!\nWe, as tourists, come to this country and visit certain sights and temples, so we may also be required to adhere to the dress code and rules that apply here. Shoulders and knees, especially for women, should be covered. If you're wearing a short summer dress, just don't go in there!! I keep seeing women who don't seem to care at all? I don't understand, because this is a belief, a religion that should be respected. You can't miss the sign indicating the dress code because it's hanging right at the entrance.\nYou don't have to be able to read, you just have to have eyes in your head.\nShoes must be taken off when entering the temple, this is also a matter of respect for the faith. You are only allowed to go in completely if you want to pray, but you still have the opportunity to look inside.\nIt is truly a beautiful, breathtaking and spiritual place.\nI give this a solid ten out of ten.",
