                              reviewText:
                                   "Very peaceful and cute place. They have some very nicely maintained gardens that are worth looking at.\n\nThe food was surprisingly nice - I recommend the goat dishes in particular. Breakfast buffet was nice, typical affair but nicely cooked.\n\nRooms are decently sized and they hang up mosquito nets every evening.\n\nThey have bikes you can rent for the day (free) and have a connection with a local motorbike rental that can drop them off at the hotel. Price was about 150k dong + 100k for petrol per day for the motorbikes.\n\nTam Coc is about 10 minutes away by bike\n\nI would go again!",
