                              reviewerName: "Maeve O'Sullivan",
                              reviewText:
                                   "One of the most perfect hotels in one of the most beautiful locations!\n\nMy friend and I had an incredible two night stay. The property is unbelievably gorgeous - they clearly put in a lot of attention and care to all of the plantings and the place feels almost magical. We stayed in one of the garden bungalows - the room was very spacious for two people and while it was too hot to enjoy the private patio, we loved the rest of the room details and were particularly fond of the aesthetics of the bathroom.\n\nWe thoroughly enjoyed breakfast both mornings and dinner both nights - the food is of high quality and there was a good variety of options. All of the staff we interacted with were very kind and helped us arrange car service both mornings to Trang An and Mua Cave.\n\nOne thing to note is this property is a bit far from the center of Tam Coc (about 5km) - it is an easy bike ride which we enjoyed one afternoon but there are no lights on the road so you need to use a motorbike or car service once it gets dark (or if it feels too hot to bike!). We were more than happy to enjoy our evenings in the pool and dinner at the restaurant on the property so this was not a deterrent for us, but something to keep in mind if you are looking to spend more time in Tam Coc itself.\n\nThe highlight for us was definitely the pool, which has the most incredible view. We would thoroughly recommend this hotel, and hope we get to come back in the future!",
