                              reviewText:
                                   "One of the best hotels I‚Äôve ever stayed in.\nTop notch service. Staff speaks English and some French and is professional and well trained.\nThis hotel is extremely well managed and organized. We never lacked anything.\nYou can message staff on Whatsapp for anything (ordering something, airport transfer, booking massage‚Ä¶) and they will reply straight away.\nThe hotel is very elegant and beautifully designed without being pretentious, and fits well within the Vietnamese countryside landscape. It is located in one of the most peaceful areas of Tam Coc in the middle of the rice fields. You can walk around the rice fields, very peaceful. Every room has a beautiful view of the rice fields.\nIf you want to go out at night to the restaurants/bars of Tam Coc, they will order a taxi for you and the drive takes between 5 and 10 minutes.\nThe food is another highlight. Breakfast was fantastic, with Asian and Western options.\nDinner was phenomenal and beautifully presented. They also have room service.\nMassage was one of the bests I ever got!",
