                              reviewText:
                                   "A stay of two halves. The second half was so good that it‚Äôs still an easy five stars and they comped us two massages and were apologetic for the first half.\n\nCut to the second part if you‚Äôre not staying in Maison Que - basically don‚Äôt stay at Maison Que if you want service and go for the hotel.\n\n1. First night was spent in their House - Maison Que - a short sampan punt over the paddy fields, 10 mins bike or 5 mins car. Fun but precarious!!\nThe house - Maison Que and the private infinity pool are beautiful. Quite quite beautiful and idyllic. Bathrooms downstairs that can be a nuisance but beautiful. The house and bedrooms all gorgeous.\nThe problem was the service - they advertise delivery from the main hotel and agreed to it in an email before we arrived. On arrival we were then told that they couldn‚Äôt do it - it was a hot pot and we can cook ourselves. Really hassly with me trying to get them to do it and them just saying no no no. Two hours later they agreed to deliver it and it was terrific and Romantic with just the two of us. But why the hassle. A really sour arrival.\n\nSaffron our travel agent organised for breakfast to be delivered but their texts started to come at 6.45 to come to the restaurant as it was raining. They point blank refused.\nThey then sent the open sampan to get us - so their view was it was fine for their guests to get wet but not the food! They told us they‚Äôd sent umbrella but that was just silly. It was so wet we would‚Äôve been soaked.\nAnyway - 30 mins after we asked we had a car. Breakfast buffet delicious and lovely.\n\nThe inference I drew, although they advertise services to Maison Que and charge a fortune for the Maison, that they aren‚Äôt set up to deliver as they say that they would. It wouldn‚Äôt have taken anytime to deliver fruit and pho.\nDon‚Äôt stay here unless maybe you get the chef option.\n\n2. Hotel. We had a standard room for the next two nights. Wish we could have binned Maison Que and stayed here -Room no7. Maybe avoid 1&2 as close to entrance and 16/7 close to pool.\nThe hotel is one of the most beautiful and gorgeous places I have ever stayed at. It‚Äôs built like a local village. Rooms overlook paddy fields, with a balcony to the side of in front - lovely big windows and Doors overlook -  gorgeous bathrooms and sitting area. Just one of the nicest rooms.\nThey spray with citronella every day. Good for mosquitoes. Very strong however. You can ask them not to spray and that addressed it.\n\nHotel breakfasts are great with pho or selection of western eggs and a huge buffet - fruit, bread, pastries coffee and tea. Restaurant manager Phuon is a good man and looked after us.\nDinner - We enjoyed the papaya salad and goat curry - the grilled duck was finally a bit western. Fresh spring rolls are lovely. We loved the hot pot.\n\nAlso had a neck and shoulder massage. Really good but be careful asking for the firm!! She is strong.\n\nMy advice is that you MUST stay here at the hotel.\nIt is gorgeous. Simply one of the best hotels I have ever stayed at. Do not miss that bit. It‚Äôs a 7 star stay.\n\nHowever, Don‚Äôt stay in Maison Que unless you are cool making your way to the hotel for food.",
