                              reviewText:
                                   "I really enjoyed Fansipan Peak. I had no idea it was owned by the same company as Ba Na Hills which I will admit, when I found out it really put me off.  I was not of fan of the latter.\n\nAll in all though it was very professionally run. The cable car to the top was enjoyable although being April, visibility was low.\n\nAside from also being on a mountain peak, it felt like a very different experience to Ba Na. We did not use the Funicular mid way but chose to take the steps to the top. It was not a difficult climb with various points of interest to stop along the way.  That said the Temples, Pagodas, statues etc‚Ä¶ all recently constructed, did set the almost ‚Äòtheme park‚Äô scene as they were clearly made for tourism purposes.\n\nSo I guess the bottom line is these are theme parks really, tourist driven‚Ä¶ the trade off being access to one at one of the highest peaks in the area.  Enjoyable if you take it for what it is.",
