                              reviewerName: "devabrat bindhani",
                              reviewText:
                                   "President Ho Chi Minh - Vietnamese hero of national liberation and great man of culture. After he passed away on September 2nd 1969, in compliance with the Vietnamese people‚Äôs aspiration, the Communist Party of Vietnam‚Äôs Politburo decided to build the Ho Chi Minh Mausoleum and the Ho Chi Minh Museum. After 20 years of preparing and building, the Ho Chi Minh Museum was inaugurated on September 2nd 1990, on the occasion of the 100th birthday of the President. Ho Chi Minh Museum has more than 170,000 decuments, objects and films about President Ho Chi Minh‚Äôs life and revolutionary work. They are invaluable assets of the Vietnamese people in educating patriotism, studying and following Ho Chi Minh‚Äôs thought and moral quallties; and encouraging the Vietnamese generations to succeed failthfully and excellently his great revolutionary work. Entry ticket price is cheap. It‚Äôs very long queues on public holidays. Food stalls are available for refreshments. Recommended.",
