                                   "Had a visit on Wednesday morning, so it is less crowded. Other days in HCM was just passed by since I stayed at a hotel nearby. It has four main entrances so it is easy to enter from any side.\n\nMy impression of this market is sellers are aggressively selling their products. As I didn‚Äôt intend to buy souvenirs from here, so I don‚Äôt dare to stop by. I just take a glance while passing by.\n\nHygiene of the food in this market I am not too sure since didn‚Äôt try it out. But I notice a street nearby has an unpleasant smell like garbage. Road surface has liquid like water coming out from garbage that make the street smelly. Not only that, I saw a worker thrown the one-time-use utensils to roadside in front of their restaurant after customer leave. This is somewhere nearby the market but not inside the market. Perhaps hygiene awareness can be improve further.",
