                              reviewText:
                                   "Wow, totally amazing experience\nThe crowds were a little overwhelming,  however, we managed a walk up through the busy streets, stopping for a drink, to sit back for 10mins and watch the world go by. They were slowly closing the street off to traffic as we sat down to a local restaurant,  just for a drink though. I loved watching people come and go, the tourists,  the locals and everyone on their way somewhere. We watched the locals use a baby pram as a walking food stall, amazing, innovative and clever way to set up shop.",
