                                   "One of the places you can't miss in Hanoi, and situated almost next to the UNESCO site ICTL ( review separately available ), the Military History Museum is full of war paraphernalia including i.a. arrows, guns, and knives. This history related to these weapons ( and it's characteristics ) is adequately explained, both in English and the local language, and one can also find references to the Vietnam ( or American ) War here.\n\nAt the entrance, there is a big and old Soviet jet as well as a tank kept on display, and as one goes ahead there are samples of bombs of various sizes kept apart from the bomb releasing machines, which were used during the war, and some of which were unearthed later in the century at various places across the country.\n\nDo note that the Museum is closed on Mon and Fri, and also during 11:30 am to 1:00 pm. I couldn't get the time to see the second building. This is also the only entry point to the Flag Tower. If one loves museums, it's unlikely that the whole museum can be seen in one visit, and will likely require two visits given the time constraints.\n\nThe museum should consider remaining open till 6 pm ( as opposed to 4:30 pm currently ) or so and/or not closing for the mid-duration of 2hrs. The entry fee is VND 40,000, and there is a coffee machine near the entry and also a restaurant inside.",
