                              reviewText:
                                   "Without a doubt, the best experience I had in my life. I‚Äôve been all around the world and this place left such an impression on me and will for a really long time. H‚ÄôAnetta (our tour guide) was very professional, fun, passionate, and very knowledgeable. On top of that, the porters and safety assistants were also spectacular and further enhanced our experience. they were incredibly helpful and the most kind hearted people.\n\nThere were 3 campsites and each one of them had its own character. Waking up to the view is to die for, sometimes it felt like I was on another planet.\n\nThe trek was challenging but also very fun, plus the safety assistants are, again, very helpful. There was a great balance between going through caves and jungles. And occasionally, you‚Äôd cross rivers too!\n\nOverall, reconnecting with nature was a success üòé",
