                              reviewerName: "Think Wisely",
                              reviewText:
                                   "Hidden beneath the lush jungles of central Vietnam lies a deep subterranean labyrinth that holds three of the world‚Äôs four biggest caves.\n\nCaves of central Vietnam‚Äôs Quang Binh province. Not when they‚Äôre big enough to fit a 40-storey building.\n\nThree of the world‚Äôs four biggest caves are in this skinniest part of the slender nation. Hundreds of other limestone caves housing deep grottoes and underground rivers are here too, with new caverns discovered every year. They‚Äôre welcome news for this area, just north of the demilitarised zone that split North and South Vietnam from 1954 until 1975. The US bombed here extensively during the Vietnam War (one crater is used as the site of an outdoor bar), and poverty hit hard for more than a decade afterwards.\n\nNow Quang Binh is the world‚Äôs hot new caving destination, home to a 126,000-hectare Unesco-protected national park whose lush tropical forests hide a vast 104km subterranean world ‚Äì making it one of the most spectacular limestone karst ecosystems on the planet.",
