                              reviewerName: "Rajesh Mondal (Devy Jones)",
                              reviewText:
                                   "The world‚Äôs largest cave, Hang Son Doong is so big it‚Äôs even got its own localised climate and clouds, a rainforest and a river. Only properly discovered in 2009, the cave is so large a 40-story skyscraper could fit at its highest point and at the widest point a Boeing 747 could glide through easily. Located in the Phong Nha-Ke Bang National Park, less people have seen the inside of this magical cave than have stood at the summit of Mount Everest.\nSon Doong, the largest cave in the world, only opened to the public in 2013. The vast expanse could house a 40-floor skyscraper with room to spare. But if you want to explore this cave, located in Phong Nha-Ke Bang National Park, be prepared to shell out the big bucks: a four-day expedition costs nearly $4,000.",
