                              reviewText:
                                   "Beautiful cave and landscape views, clearly the team was very knowledgable in terms of safety and caves in general.\n\nThe cave has tons of gorgeous views with light shining down from the skies at greenery or clear waters to swim in. Although trekking was a bit tough, it was 100% worth every last bit of energy and talking to the safety assistants and friends made it more fun than tiring. Climbing under, over, and through rocks was so exciting and I could not have been more elated by this once-in-a-lifetime experience (I'm so jealous if you get to go more than once).\n\nThere cannot be enough compliments said about the safety assistants. Incredibly kind, caring, and funny as well if you can understand them. Took care of everyone equally but understood when sometimes someone needed extra help.\n\nFood was so delicious it makes every other restaurant in Vietnam look bad, and that's not because we were tired from trekking. The food was genuinely incredible, rivaling and surpassing my Viet grandma's cooking (ch√°u xin l·ªói b√† ngo·∫°i hihi). Oxalis has made meals prepared by anyone else disappointing.\n\nI commend Oxalis for all its efforts in making the experience extremely eco friendly, it was obvious that they take great care in keeping the cave as untouched as possible. Overall this experience could not be what it is without Oxalis so all the praise to them!",
